import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import './Intro.css';

function Intro() {

  return (
    <div className='introContainer'>
        <div className='introTitle'>
            <h1>Intro.</h1>
        </div>
        <div className='introParagraph'>
            <p>Hello there! I'm</p>
            <h2>Yongseok Choi</h2>
            <p>A Front-End Web Developer.</p>
        </div>

    </div>
  );
}

export default Intro;
